Jack Justice (Tommy &quot;Tiny&quot; Lister) is an LAPD cop, who is suspended from the police force due to his reckless actions while fighting crime. Jack travels to a Texas border town and teaches the corrupt sheriff (John Schneider) his brand of lethal justice. 

Director: Demetrius Navarro
Writers: Jerry Bryant (story), Demetrius Navarro (screenplay)
Stars: John Schneider, Tommy 'Tiny' Lister, James Russo 
Genres: Action
Country: USA
Language: English


